import React from 'react';
import './App.css';

import Navigation from './components/Navigation'


function App(props) {

  return (
    <div className="App">
       <h1>GaeTaeng's React Project</h1>

      <hr/>
    <Navigation />
    </div>
  );
}

export default App;



